-- USER_PROFILE 테이블

CREATE TABLE USER_PROFILE(
	USER_ACCOUNT_ID VARCHAR2(14) CONSTRAINT account_id_pk PRIMARY KEY,
	USER_EMAIL VARCHAR2(320) UNIQUE NOT NULL,
	USER_PASSWORD VARCHAR2(60) NOT NULL,
	USER_NAME VARCHAR2(50) NOT NULL,
	USER_NICKNAME VARCHAR2(50) CONSTRAINT nick_name_uk UNIQUE NOT NULL,
	USER_AUTH CHAR(2) NOT NULL,
	USER_PHONE_NUMBER VARCHAR2(12) UNIQUE NOT NULL,
	USER_AUTO_LOGIN_TOKEN VARCHAR2(60) UNIQUE NOT NULL,
	USER_JOIN_DATE DATE DEFAULT SYSDATE NOT NULL,
	USER_LAST_ACCESS_DATE DATE DEFAULT SYSDATE NOT NULL,
	USER_GENDER CHAR(2) NOT NULL,
	USER_SITE CHAR(2) DEFAULT 'T',
	USER_BIRTH DATE NOT NULL,
	USER_PROFILE_FILE VARCHAR2(1000) DEFAULT '기본경로 잡아주기' NOT NULL,
	USER_DELFLAG CHAR(2) DEFAULT 'N' NOT NULL,
	USER_CHADAN_COUNT NUMBER DEFAULT 0,
	USER_CHADAN_REGIST_DATE DATE
);

COMMENT ON TABLE USER_PROFILE IS '서비스 일반 사용자의 정보를 담는 테이블';
COMMENT ON COLUMN USER_PROFILE.USER_ACCOUNT_ID IS '회원 고유 아이디';
COMMENT ON COLUMN USER_PROFILE.USER_EMAIL IS '회원 이메일';
COMMENT ON COLUMN USER_PROFILE.USER_PASSWORD IS '비밀번호';
COMMENT ON COLUMN USER_PROFILE.USER_NAME IS '회원명';
COMMENT ON COLUMN USER_PROFILE.USER_NICKNAME IS '회원 닉네임';
COMMENT ON COLUMN USER_PROFILE.USER_AUTH IS '권한';
COMMENT ON COLUMN USER_PROFILE.USER_PHONE_NUMBER IS '회원 휴대폰 번호';
COMMENT ON COLUMN USER_PROFILE.USER_AUTO_LOGIN_TOKEN IS '자동로그인 토큰';
COMMENT ON COLUMN USER_PROFILE.USER_JOIN_DATE IS '가입일';
COMMENT ON COLUMN USER_PROFILE.USER_LAST_ACCESS_DATE IS '최근 접속일';
COMMENT ON COLUMN USER_PROFILE.USER_GENDER IS '성별';
COMMENT ON COLUMN USER_PROFILE.USER_SITE IS '가입사이트';
COMMENT ON COLUMN USER_PROFILE.USER_BIRTH IS '생년월일';
COMMENT ON COLUMN USER_PROFILE.USER_PROFILE_FILE IS '프로필 이미지 파일';
COMMENT ON COLUMN USER_PROFILE.USER_DELFLAG IS '삭제여부';
COMMENT ON COLUMN USER_PROFILE.USER_CHADANCOUNT IS '로그인 실패 횟수';
COMMENT ON COLUMN USER_PROFILE.USER_CHADAN_REGIST_DATE IS '로그인 5회 실패시 차단 등록일자';

